package pojo.arrays;

import java.util.ArrayList;

import pojo.UpdatedTextField;

public class UpdatedTextFields {

	private ArrayList<UpdatedTextField> updatedTextField;

	public UpdatedTextFields() {
		super();
		// TODO Auto-generated constructor stub
	}

	public ArrayList<UpdatedTextField> getUpdatedTextField() {
		return updatedTextField;
	}

	public void setUpdatedTextField(ArrayList<UpdatedTextField> updatedTextField) {
		this.updatedTextField = updatedTextField;
	}

	@Override
	public String toString() {
		return "UpdatedTextFields [updatedTextField=" + updatedTextField + "]";
	}
	
	
	
}
